// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'Navbar'.
function Navbar() {
    return (
        // Navbar Container.
        <nav class="navbar navbar-expand-lg navbar-dark bg-steel">
            {/* Navbar Brand */}
            <a class="navbar-brand" href="/">Shawn Luther</a>
            {/* Mobile Collapse Icon (Hamburger) */}
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                {/* Hamburger Icon */}
                <span class="navbar-toggler-icon"></span>
            </button>
            <form class="form-inline my-5 my-lg-0 ml-auto">
                <input class="form-control" type="search" placeholder="Search" aria-label="Search" />
                <button class="btn btn-outline-white btn-md my-2 my-sm-0 ml-3" type="submit">Search</button>
            </form>
            {/* Navbar Mobile Collapse Container */}
            <div class="collapse navbar-collapse" id="navbarText">
                {/* Navbar Unordered Link List Container */}
                <ul class="navbar-nav text-right">
                    {/* Item #1 - 'About Me' */}
                    <li class="nav-item active">
                        <a class="nav-link" href="#">About Me
                            <span class="sr-only">(current)</span>
                        </a>
                    </li>
                    {/* Item #2 - 'Skills & Projects' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#">Skills & Projects</a>
                    </li>
                    {/* Item #3 - 'Contact' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#">Contact</a>
                    </li>
                </ul>
            </div>
        </nav>
    );
}

// Do export.
export default Navbar;
